INSERT INTO `tools` VALUES (26,'2018-11-03 10:29:33','user','_Tool cports.exe','CurrPorts is network monitoring software that displays the list of all currently opened TCP/IP and UDP ports on your local computer.','file','cports.exe','','','[\"/stab\"]','[\"none\"]','[\"Tab-delimited text file\"]',1,'0','/sxml','[\"local_port\",\"local_address\",\"state\",\"process_path\",\"process_name\"]','[\"2\",\"3\",\"4\",\"5\",\"1\"]','CurrPorts is network monitoring software that displays the list of all currently opened TCP/IP and UDP ports on your local computer. For each port in the list, information about the process that opened the port is also displayed, including the process name, full path of the process, version information of the process (product name, file description, and so on), the time that the process was created, and the user that created it. \r\nIn addition, CurrPorts allows you to close unwanted TCP connections, kill the process that opened the ports, and save the TCP/UDP ports information to HTML file , XML file, or to tab-delimited text file. \r\nCurrPorts also automatically mark with pink color suspicious TCP/UDP ports owned by unidentified applications (Applications without version information and icons)',0,1),(27,'2018-11-03 15:21:12','user','Tool nmap','Nmap(“Network Mapper”) is a security tool used to detect computers and services on a network.','file','nmap\\nmap.exe','','','[\"-p\",\"-p\",\"-sP\",\"-sv\",\"-O\"]','[\"service\",\"host\",\"network\",\"host\",\"host\"]','[\"Ports numbers\",\"Analyse ports on host\",\"Hosts discovery\",\"Programs and version on listening ports\",\"SO detecting\"]',1,'1','-oX','[\"address\",\"hostname\"]','[\"Adress for host\",\"Nome for host\"]','Tests with tool nmap.',1,1),(28,'2018-11-07 23:30:13','user','CRT.SH','Display information about TLS/SLL certificates','domain','','https://crt.sh/','','[\"?q=%\"]','[\"domain\"]','[\"Find all information\"]',0,'1','','','','',1,0),(30,'2018-12-10 13:49:41','user','usb view','